import React from "react";
import ReactDOM from "react-dom";
/** @jsxRuntime classic */
/** @jsx jsx */
import { jsx } from "theme-ui";
function MainPage() {
  return (
    <div
      sx={{
        pl: [1, 2, 3],
        pr: [1, 2, 3],
        pt: [1, 2, 3],

        display: "flex",
        flexDirection: "column",
        // minHeight: '100vh',
        height: "100vh",
        width: "100vw",
        bg: "#E7B996",
      }}
    >
      <div
        sx={{
          flexDirection: "row",
        }}
      >
        1
      </div>
      <div
        sx={{
          flexDirection: "row",
        }}
      >
        2
      </div>
      <div>3</div>
    </div>
  );
}

export default MainPage;
